export default function RegisterPage(){
    return(
        <div className="form">
            <form action="" className="register">
                <h2>Register</h2>
                <input type="text" placeholder="username"></input>
                <input type="password" placeholder="password"></input>
                <button>Register</button>
            </form>
        </div>
    )
}
